import React, { Component } from 'react';
import MainTitle from '../components/pageTitle';
import Text from '../components/mainText';

import '../App.css';

const TableHeader = () => {
  return (
    <thead>
      <tr>
        <th>Name</th>
        <th>Job</th>
      </tr>
    </thead>
  );
};

class Table extends React.Component {
  render() {
    return (
      <table>
        <TableHeader />
        <tbody>
          <tr>
            <td>
              <Text classprop="main-text" label="Player" />
            </td>
            <td>Janitor</td>
          </tr>
          <tr>
            <td>Mac</td>
            <td>Bouncer</td>
          </tr>
          <tr>
            <td>Dee</td>
            <td>Aspiring actress</td>
          </tr>
          <tr>
            <td>Dennis</td>
            <td>Bartender</td>
          </tr>
        </tbody>
      </table>
    );
  }
}
export default Table;
